import React from 'react'
import "./button.css"

export const ImportExcelButton = ({
    children,
    type,
    onclick,
    buttonStyle,
    buttonSize
}) => {
    return (
        <button onclick={onclick} type={type}>
            {children}
        </button>
    )
}
